<p>За да работите с таро са ви нужни само колода, въпрос и доверяваща се на магията душа. Един от основните начини за изучаване на таро е да теглите карта за себе си всеки ден. Чрез собствените си представи и живот ще можете да се докоснете до значението на картите на ново и по-дълбоко ниво. С тази класическа колода на Райдър Уейт и илюстрации на Памела Колман Смит ще се потопите в енергията на таро и ще научите повече както за себе си, така и за хората около вас.</p>
               <p><strong>Картите идват в удобна кутия с отделен капак.</strong></p>
                                            


